import React, { useState } from 'react';
import { Form, Input, Checkbox, Switch, Radio, Button, Select, Typography } from 'antd';
import "./FormComponent.css";
import { log } from 'console';

const { Group: RadioGroup } = Radio;

const { Option } = Select;

const FormComponent: React.FC = () => {

  const inputText = [
    {
      title: 'Username',
      value: 'username',
      type: 'text',
      placeHolder: 'Enter username',
      error: 'Please input your username!',
    },
    {
      title: 'Password',
      value: 'password',
      type: 'password',
      note: 'Your password is betwween 4 and 12 characters',
      placeHolder: 'Enter password',
      error: 'Please input your password!',

    },
    {
      title: 'Text Field',
      value: 'textField',
      type: 'text',
      placeHolder: 'Input Field',
      error: 'Please input text field!',
    },
  ];

  const [rememberMe, setRememberMe] = useState(false);
  const [switchValue, setSwitchValue] = useState(false);
  const [radioValue, setRadioValue] = useState(1);

  const handleSwitchChange = (checked: boolean) => {
    setSwitchValue(checked);
  };

  const handleRadioChange = (e: any) => {
    setRadioValue(e.target.value);
  };

  const handleCancel = () => {

  };

  const finishForm = (value:any) => {
    console.log(value);

  };

  const options = [
    { label: 'Dropdown Option', value: 'Radio Selection 1' },
    { label: 'Dropdown Option 1', value: 'Radio Selection 2' },
    { label: 'Dropdown Option 2', value: 'Radio Selection 3' },
  ];

  return (
    <div className="form-container">
      <Form onFinish={finishForm}>
        <div className='form-content'>
          <Form.Item name="FormConponent" className='input-field'>
            {inputText.map((item) => (
              <div
                key={item.value}
                className='form-group'
              >
                <Typography.Text className='title'>{item.title}</Typography.Text>
                <div>
                  <Form.Item
                    name={item.value}
                    rules={[
                      {
                        // required: true,
                        message: item.error,
                      },
                    ]}
                  >
                    <Input
                      type={item.type}
                      placeholder={item.placeHolder}
                    />
                    <div className='notice text-shadow'>
                      <span>{item.note}</span>
                    </div>
                  </Form.Item>
                </div>
              </div>
            ))}
          </Form.Item>
          <div className='content-down'>
            <div className='form-group'>
              <Form.Item>
                <Checkbox
                  checked={rememberMe}
                  onChange={e => setRememberMe(e.target.checked)}
                >
                  Remember me
                </Checkbox>
              </Form.Item>
            </div>
            <div className='form-group'>
              <Form.Item>
                <Switch
                  checked={switchValue}
                  onChange={handleSwitchChange}
                />
                <span className='switch-mode'>
                  {switchValue ? "On" : "Off"}</span>
              </Form.Item>
            </div>
            <div className='form-group'>
              <Form.Item>
                <RadioGroup
                  onChange={handleRadioChange}
                  value={radioValue}>
                  <div>
                    <Radio value={1}>Radio Selection 1</Radio>
                  </div>
                  <div>
                    <Radio value={2}>Radio Selection 2</Radio>
                  </div>
                  <div>
                    <Radio value={3}>Radio Selection 3</Radio>
                  </div>
                </RadioGroup>
              </Form.Item>
            </div>
            <div className='form-group'>
              <Form.Item>
                <label className="dropdown-title">Dropdown Title</label>
                <Form.Item name="dropdown">
                  <Select className='dropdown' placeholder="Dropdown Option">
                    {options.map(option => (
                      <Option key={option.value} value={option.value} className="custom-option">
                        {option.label}
                      </Option>
                    ))}
                  </Select>
                </Form.Item>
              </Form.Item>
            </div>
            <div className='form-buttons'>
              <Form.Item>
                <Button onClick={handleCancel} className='cancelBtn'> Cancel </Button>
                <Button type="primary" htmlType={"submit"} className='nextBtn'> Next </Button>
              </Form.Item>
            </div>
          </div>
        </div>
      </Form>
    </div>
  );
};

export default FormComponent;
